import { Component } from '@angular/core';

@Component({
  selector: 'app-bienvenido',
  templateUrl: './bienvenido.component.html',
  styleUrls: ['./bienvenido.component.css']
})
export class BienvenidoComponent {

}
<div class="mx-0">
    <button class="btn btn-primary" href="www.google.com" >Bienvenido</button>
    <button class="btn btn-primary" href="http://localhost:4200/servicios">servicios</button>
</div>


<div class="mt-2">
    <img class="rounded float-right" src="https://clinicaimif.com/wp-content/uploads/2019/06/rehab.jpg">
</div>
